Alex_Blumi/status/998303738589741056"}],"timestamp":"2018-05-23T08:43:56.140000+00:00","edited_timestamp":null,"content":"Das w\u00e4re mein Vorschlag, Nena geht immer! Hat aber leider nicht die gehoffte Resonanz erzeugt\ud83d\ude05  https://twitter.com/Alex_Blumi/status/998303738589741056","author":137,"s":343,"mentions":[]},{"id":"448812528747675649","attachments":[],"embeds":[{"url":"https://youtu.be/W2cEXZNYY78"}],"timestamp":"2018-05-23T11:40:45.387000+00:00","edited_timestamp":null,"content":"Hier mein Vorschlag: \nhttps://youtu.be/W2cEXZNYY78\n\nHat an verschiedenen Stellen leider nicht die gew\u00fcnschte Aufmerksamkeit erhalten, ich finde aber es ist trotzdem ein tolles Lied mit klarem Bekenntnis zu Europa, einer Botschaft f\u00fcr den Frieden in der Welt und es wurde von Kindern gemacht, die ja bekanntlich die besseren Erwachsenen sind ... was will man mehr \u2764\ufe0f","author":138,"s":344,"mentions":[]},{"id":"448866939352252416","attachments":[],"embeds":[{"url":"https://youtu.be/g9ScJqtRIno"}],"timestamp":"2018-05-23T15:16:57.886000+00:00","edited_timestamp":null,"reactions":[{"count":2,"emoji":{"name":"\u2764"}}],"content":"... Ich h\u00e4tte da auch noch was zum \"Auftanken\" f\u00fcr uns aus der Schatzkiste von U2:   \"Pride - In the name of LOVE\" in Memory auf Martin Luther King \nQuelle :  https://youtu.be/g9ScJqtRIno\n\n\u003ciframe width=\"640\" height=\"360\" src=\"https://www.youtube.com/embed/g9ScJqtRIno\" frameborder=\"0\" allow=\"autoplay; encrypted-media\" allowfullscreen>\u003c/iframe>","author":139,"s":345,"mentions":[]},{"id":"450438976222789633","attachments":[],"embeds":[{"url":"https://www.youtube.com/watch?v=NPBkiBbO4_4"}],"timestamp":"2018-05-27T23:23:40.683000+00:00","edited_timestamp":null,"content":"Ich hoffe, ich bin noch nicht zu sp\u00e4t \"The Supremes - Stop In The Name Of Love\". https://www.youtube.com/watch?v=NPBkiBbO4_4","author":140,"s":346,"mentions":[]},{"id":"450576633993101312","attachments":[],"embeds":[],"timestamp":"2018-05-28T08:30:40.853000+00:00","edited_timestamp":"2018-05-28T10:00:45.801000+00:00","reactions":[{"count":8,"emoji":{"name":"\u2764"}},{"count":5,"emoji":{"name":"\ud83d\udc4d"}}],"content":"Hallo @everyone, vor allem aber an die @Admins\nmein erster Post hier. Ich hoffe, ich mache nichts falsch. \n\nBerlin muss fantastisch gewesen sein - aber das Echo darauf gef\u00e4llt mir nicht so recht. Hier Ausz\u00fcge aus dem FB-Post einer Freundin:\n\n\"Wir waren erst auf der Reichstagswiese und sind dann mit tausenden anderen bis nach vorne zur AFD-Kundgebung und haben richtig viel Krach gemacht (Friedlich.) und den rechten Hanseln gezeigt, dass sie mit ihrer Hetze in unserer Stadt und unserer Demokratie keinen Punkt machen k\u00f6nnen. Dieses Wir war in meiner Wahrnehmung auch viele, die sonst nicht bei \"Antifa-Demos\" sind. Hier hat sich die Mitte der Gesellschaft sehr friedlich, mit Humor und Lebensfreude gegen Rechtsgestellt: Studis, Familien (ich stand irgendwann neben Enkel, Tochter, Oma aus Zehlendorf - und hey, ich bins fast 50 und wohne im b\u00fcrgerlichen Wilmersdorf...), Leute wie ich, die meisten nicht als Parteianh\u00e4nger*innen erkennbar. Superstimmung! Wir waren so grandios viel mehr, lauter, toller!\n\nLeider wurde meine Euphorie durch die Medien ged\u00e4mpft. Die AFD wird hochgeschrieben, die Gegendemos werden kleingeschrieben. Der Protest wird omin\u00f6s als \"bunt\" bezeichnet., die Demo der Clubs als hedonistische, unpolitische Loveparade abgetan. Und bei Anne Will diskutiert man mal wieder \u00fcber Asylthemen - mit Gauland.\"\n\nIch meine, hier m\u00fcssen wir unbedingt mit Masse, Bildern, Fakten, politischen Statements - dagegenhalten. W\u00fcrde mich freuen, wenn von euch dazu was kommt.","author":141,"s":347,"mentions":[]},{"id":"450656084680507392","attachments":[],"embeds":[{"url":"http://www.sueddeutsche.de/politik/protest-gegen-die-afd-in-berlin-als-waere-mal-wieder-loveparade-1.3992938"}],"timestamp":"2018-05-28T13:46:23.373000+00:00","edited_timestamp":null,"content":"\u003c@446751392023969793> Das stimmt mich traurig. Hier in M\u00fcnchen scheinen wir wirklich auf der Insel der Gl\u00fcckseligen zu leben, denn was ich gelesen habe, war das, was ich in der freiheitlich-demokratischen Presse auch erwarten w\u00fcrde: http://www.sueddeutsche.de/politik/protest-gegen-die-afd-in-berlin-als-waere-mal-wieder-loveparade-1.3992938","author":118,"s":348,"mentions":[141]},{"id":"450659109298110464","attachments":[],"embeds":[],"timestamp":"2018-05-28T13:58:24.498000+00:00","edited_timestamp":null,"reactions":[{"count":3,"emoji":{"name":"\ud83d\udc4d"}}],"content":"\u003c@443394982196543488> \u003c@446751392023969793> Ich glaube das ist der falsche Channel zu dem Thema \ud83d\ude09 Hier werden Beitr\u00e4ge zu den gegenw\u00e4rtigen Challenges (die letzte zur Deutschen Nationalhymne) gepostet. Im \u003c#441251984990011392> w\u00e4ret ihr vielleicht besser aufgehoben \ud83c\udf3b","author":40,"s":349,"mentions":[118,141]},{"id":"450665428407156736","attachments":[],"embeds":[],"timestamp":"2018-05-28T14:23:31.091000+00:00","edited_timestamp":null,"reactions":[{"count":3,"emoji":{"name":"\u2764"}}],"content":"\u003c@439322320541319170>  Ich hatte gehofft, dass eine Challenge daraus werden kann. Ein Chat bringt uns da nicht weiter, f\u00fcrchte ich. \ud83d\ude09 \nAber danke f\u00fcr den Hinweis.","author":141,"s":350,"mentions":[40]},{"id":"450757857617379328","attachments":[],"embeds":[{"url":"https://youtu.be/q6Livw18ZoI"}],"timestamp":"2018-05-28T20:30:47.932000+00:00","edited_timestamp":null,"reactions":[{"count":2,"emoji":{"name":"\ud83c\udfa7"}}],"content":"Ohne nun wirklich bei der Challenge mit zu mischen, ein Vorschlag.   https://youtu.be/q6Livw18ZoI","author":142,"s":351,"mentions":[]},{"id":"450933488242393088","attachments":[],"embeds":[],"timestamp":"2018-05-29T08:08:41.536000+00:00","edited_timestamp":"2018-05-29T08:12:47.434000+00:00","content":"@everyone Guten Morgen ihr Lieben!\n\nD
